import React from 'react';
import { Link } from 'react-router-dom';
import { useForm } from 'react-hook-form';

import Vectors from '../../assets/img/Vectors.png';
import logofb from '../../assets/img/logofb 1.png';
import logoemail from '../../assets/img/logoemail.png';
import DarkMode from '../../assets/img/DarkMode.png';

const Login = () => {
    const {
        register,
        handleSubmit,
        formState: { errors },
    } = useForm();
    const onSubmit = (data) => {
        console.log(data);
    };

    return (
        <div className="h-screen w-screen">
            <div className="bg-slate-100 h-full w-full relative flex flex-col ">
                <div className="mx-auto mt-20 gap-y-4 flex flex-col lg:w-[727px] lg:h-[581px] md:w-[527px] md:h-[581px] w-[327px] ">
                    <div className="flex flex-col gap-y-2 font-medium">
                        <h1 className="text-4xl font-sans items-center justify-center flex">Sign In</h1>
                        <h6 className="items-center justify-center flex mt-2 lg:mb-10 md:mb-10 mb-4 ">
                            Enter your email and password below
                        </h6>
                    </div>
                    <form onSubmit={handleSubmit(onSubmit)}>
                        <div className="flex flex-col lg:gap-y-6 md:gap-y-6 gap-y-5">
                            <div className="">
                                <input
                                    type="email"
                                    placeholder="Email"
                                    className="px-3 py-3 rounded-lg bg-[#052B12] text-white w-full"
                                    {...register('email', { required: true })}
                                />
                                {errors.email && <p className="text-red-600">This field email is required</p>}
                            </div>
                            <div>
                                <input
                                    type="password"
                                    placeholder="Password"
                                    className="px-3 py-3 rounded-lg bg-[#052B12] text-white w-full"
                                    {...register('password', { required: true })}
                                />
                                {errors.password && <p className="text-red-600">This field password is required</p>}
                            </div>
                        </div>

                        <div className="flex flex-col lg:flex-row lg:justify-between md:flex-row md:justify-between px-2 lg:my-4 md:my-4 items-center justify-center gap-y-2 my-2 ">
                            <div className="flex gap-x-2 ">
                                <input type="checkbox" className="bg-col -[#052B12] w-5  valid:border-green-500" />
                                <label htmlFor="" className="text-[#052B12]">
                                    Remember me
                                </label>
                            </div>
                            <div className="px-4 ">
                                <Link to={'/forgot'} className="text-[#052B12] underline hover:text-blue-800 ">
                                    Forgot password ?
                                </Link>
                            </div>
                        </div>
                        <div className=" flex items-center justify-center bg-[#267693] rounded  text-white hover:bg-[#052B12] cursor-pointer lg:mt-16 md:mt-12 mt-8">
                            <button className="w-full h-full px-2 py-3">Login</button>
                        </div>
                    </form>
                    <div className="flex justify-center items-center">
                        Don't have an account?{' '}
                        <Link to={'/signup'} className="text-blue-800 font-medium ml-1 underline">
                            Sign up
                        </Link>
                    </div>
                    <div className="flex items-center justify-center lg:gap-x-8 md:gap-x-6 gap-x-4 mt-4">
                        <img src={logofb} alt="" className="w-8 h-8 cursor-pointer" />
                        <img src={logoemail} alt="" className="w-8 h-8 cursor-pointer" />
                    </div>
                </div>
                <div className=" object-cover absolute bottom-0 w-full ">
                    <img src={Vectors} alt="" className="w-full h-full " />
                </div>
                <div className="absolute bottom-6 left-6">
                    <img src={DarkMode} alt="" />
                </div>
            </div>
        </div>
    );
};

export default Login;
